import React from 'react'

const Home = props => {

    return(
        <>
            <h1>Early Learning Games!</h1>
            <div className="homepage-box" onClick={()=>{props.history.push(`game`)}}>
                <h3>Quizzes</h3>
                <p>Learn through answering multiple choice questions</p>
            </div>
        </>
    )
}

export default Home
